import "./App.css";
import React, { Component } from "react";
import name from "./name.png";

export default class App extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="App">
        <a href="/" aria-current="page" aria-label="home">
          <img src={name} width="149" alt="" />
        </a>
        <div>Navigation</div>
        <div>
          <h1>
            Hola - I'm Caro Collazo :)
            <br />A creative...
          </h1>

          <div>
            <i>currently a software engineer @ Microsoft</i>
          </div>
        </div>
        <div>
          <div>Project 1</div>
          <div></div>
          <div></div>
          <div></div>
        </div>
      </div>
    );
  }
}
